      "description": "Our personalized cutting boards are engraved with a beautiful design of your choice.\n=======================================\nPersonalized Cutting Boards are the perfect and touching gift for friends or loved ones for any occasion. They are perfect for housewarming gifts, hostess gifts, special occasion moments, wedding gifts, and anniversary gifts.\n\nOne side is engraved and the other side is left blank so you can actually use.\nCutting boards are handmade from natural hard wood. They are strong and durable.\nSIZE:  8&#39;&#39; x 12&#39;&#39; x 0,75&#39;&#39; inches (20x30x2 cm)Dark Beech 7 * 8.5 inches\nMaterial: OAK, Dark Beech\n=======================================\nORDERING:\nTo purchase our beautifully engraved cutting boards all you need to do is add the desired product to your cart and put the custom information you would like on your cutting board in the &quot;Notes to seller&quot; section, exactly how you would like it to appear.\n--- Select the quantity and availability of gift wrapping from the Drop Down Menu on this listing. Add to your cart.\n--- ADDING THE PERSONALIZATION TO YOUR ORDER: As you check out you will see a “Notes to Seller” section. This is where you will put the personalization details of your order.\nDepending on the design that you are purchasing, you will need to include Name or Names, Letters, Dates or Phrases needed for personalizing the design. Everything in the design that can be personalized is where you need to tell us what that personalization needs to be.\n=======================================\nEXAMPLE:\n\nAutumn and Jeremiah\nJuly 13, 2019\n=======================================\n--- Check your spelling carefully before submitting order as we copy and paste your provided text.\nPlease, write the text exactly as you want it to appear on the board.\nWe will copy and paste whatever will be provided.\n---  When you check out, please make sure the shipping address is correct. If you want to ship it directly to the recipient, please change the shipping address at this time.\n--- If you would like a proof please let us know in the &quot;note to seller&quot; box during check-out and we will send your proof via Etsy conversations within 2 business days after the order has been received. Otherwise, we will use your text that you provide during check-out.\nALL COMMUNICATION IS TO BE THROUGH THE ETSY CONVERSATION SYSTEM.\n=======================================\nTECHNOLOGY:\n Our boards are made from natural wood and no stain ever used in the process. Due to natural origin of the wood there will be color variations that might be different from what is shown in our listings.\nOAK boards may be dark brown, light brown, or brown with yellow-white tones. Engraved oak has beautiful contrast, it can have marked graining that will be revealed. \n Engraving process is a burning process by high density laser beam that doesn&#39;t provide coloration and engraving color is solely depends on that particular piece of wood and how it reacts to laser beam.\n Seasoned with food safe oil prior to shipping. Then you can treat it as needed with a food safe mineral oil.\n-------------------------------------------------------------------------------------------\nRECOMMENDATIONS FOR USE\n\nWood alone can not protect your board from abuse and neglect. All wood cutting boards usually require regular maintenance with mineral oil or beeswax to keep the wood from cracking and warping. Additionally, we do not recommend putting any of our boards in the dishwasher, or letting it soak in water for a long period of time. This will lead to splitting and damage to the wood.\n-------------------------------------------------------------------------------------------\nSHIPPING INFORMATION:\nShipping worldwide from Ukraine\n- We guarantee shipping within 6 - 8 working days after payment\n- The delivery time from Ukraine: 10-25 days\n- Item will be quality packed with tracking numbers\n\nWedding Gift Cutting Board / Personalized Engraved Cutting Board / Bride and Groom / Personalized Cutting Board / Star Wars cutting board",
