        "policy_welcome": "Founded in 2011, BabyBinkz is your source for cleverly presented, practical baby gifts.  With just a touch of snark & sarcasm, we don’t take ourselves or gifting too seriously. After all, we’re not the ones having the baby! \r\n  \r\nOur products are a great alternative to the typical registry or gift card purchase!  Creative products that are practical too – and you don’t have to walk through the breast pump aisle to get ‘em.  You’re welcome.  \r\n\r\nYes.  We charge for our products, but the snark & sarcasm is completely complementary. You’re welcome again!\r\n\r\nTake a look at our products & have fun!  If you have a great idea for a gift, but we didn&#39;t think of it first (it could happen), let us know.  Custom orders are always fun to work on & we love to be bossed around!",
        "policy_payment": "BabyBinkz accepts payment via Credit Card and PayPal.  ",
        "policy_shipping": "All products are handmade and generally have a production time of 3-5 days prior to shipping.  \r\n\r\n~~~~DOMESTIC SHIPPING~~~~\r\n\r\nBabyBinkz ships via First Class Mail (2-5 days) and Priority Mail (2-3 days) depending on order size and weight.  \r\n\r\n~~~~INTERNATIONAL SHIPPING~~~~\r\n\r\nFor international orders, BabyBinkz ships via First Class International Mail with the USPS. Once your purchase is shipped, it will spend 3 - 6 weeks in transit.\r\n\r\nIf you would like to upgrade your order to Priority International Shipping (usually 6 - 10 business days in transit) please message me and I can calculate the shipping costs for you.\r\n\r\nAny taxes, duties, VAT or customs fees are the buyer&#39;s (your) responsibility. BabyBinkz is unable to predict if there will be fees incurred and/or what these fees could be. Check with your country&#39;s international postal laws and/or postal regulations.\r\n\r\n\r\nBabyBinkz is not responsible for any lost packages or delays in your shipping due to the USPS. Please double check your address in Etsy - we are NOT responsible for lost packages due to incorrect addresses, nor will BabyBinkz pay extra shipping to re-send a package that is returned to us due to an incorrect address listed. \r\n\r\nIf you need a package to be shipped priority, overnight, or would like insurance I can do this per your request for an additional charge. Contact me prior to ordering for a shipping estimate.",
        "policy_refunds": "Have no fear.  I make all the products myself & I’m totally Type A and borderline OCD.   \r\n\r\nBut really, if you don’t love BabyBinkz products as much as that “new baby” smell, let me know within 30 days of your purchase.  I love making our products and want you to love them too!  \r\n\r\n We want to make you happy!  So, If you are not satisfied with your purchase, please let us know ASAP (that’s as soon as possible for those not fluent in acronyms). We will process a full refund (minus applicable original shipping costs) for returns of unused, unopened products.  \r\n\r\nRefunds will be processed upon return of products received within 21 calendar days of the original delivery date. Refunds will not be processed for any products that have been removed from their packaging.  \r\n\r\nSorry, but returns requested after 21 calendar days are destined for a lifetime next to your bowling ball in the guestroom closet.    ",
        "policy_additional": "Copyright © BabyBinkz.™\r\n\r\n© All Rights Reserved by BabyBinkz.™ We retain copyright to all designs, images, text, and content in this shop. Any and all reproduction without permission is forbidden. Thank you. \r\n",
