        "creation_tsz": 1300395593,
        "title": "Unique Hand Crafted Jewelry and Accessories",
        "announcement": "Hi and thanks for stopping in.  Large selection of Mens Accessory items for suit and ties including tie clips and cuff links. Be sure to check out our huge selection of belly rings. \r\n",
        "currency_code": "USD",
        "is_vacation": false,
        "vacation_message": null,
        "sale_message": "THANK YOU FOR PURCHASING ONE OF OUR PRODUCTS!  We hope you enjoy it and find value in its wear.  We strive to make our jewelry and accessory items durable yet fashionable.  If you have a questions or concerns about the item you purchased, please contact us.   My goal is to make you happy.  I will refund your money, exchange it for another similar item if I can or give you a shop credit.\r\nThanks,\r\nTammy",
        "digital_sale_message": null,
        "last_updated_tsz": 1553284359,
        "listing_active_count": 1648,
        "digital_listing_count": 0,
        "login_name": "agothshop",
        "accepts_custom_requests": true,
        "policy_welcome": "Hi and welcome to my shop.  I will try to keep this brief and not bore you with a lot of text so you will understand our policies regarding payment, returns, shipping and packaging.\r\n\r\nAt A Goth Shop we strive to make our items functional, beautiful and durable.  We use the best materials at a price we feel is acceptable to the majority of our clients.  Hopefully your purchase will bring you many hours of enjoyment and wear.",
        "policy_payment": "Please pay for your item within 7 days from  purchase date.  Thank you.   We accept Paypal as our only means of payment.  You may pay as a guest to Paypal with your debit or credit card or personal check.  Checks take time to clear, usually withing 5-7 working days and we will ship only after it clears.",
        "policy_shipping": "We ship in bubble envelopes to ensure product protection.  Larger items such as complex necklaces will be bubble wrapped and boxed.  All rings and flasks are bubble wrapped and shipped boxed to ensure against crush damage. Once the product has be shipped we can not be responsible for damage incured during the shipping process.  It is the buyers responsibility to follow up on any claims to the carrier.  However, we will do everything in our power to ensure your package is delivered in good shape and with no damage.\r\n\r\nContact us if you want the item shipped insured.  This is an additional charge.  We will contact you with the total amount prior to shipping for your approval on the charges.  Insurance is not included on Free Shipping items, it is an additional charge.\r\n\r\nIf you desire to have an item shipped insured, please do not pay for the item until you hear back from us regarding total price.  Please include a brief note letting us know you would like the item insured at the time of purchase.\r\n\r\nWe usually ship next day after payment as most of our items are in stock.  If you do not receive your item within 10 days, please contact us.  We will try to resove any shipping issures with the carrier.  We ship usually via USPS first class mail which includes a tracking number.",
        "policy_refunds": "RETURNS:  Every attempt is made to insure our product is defect free prior to shipping.  Once in a while one may slip though.  We do accept returns on any item made in our shop for defects on workmanship or materials.  Occasionally the buyer just does not like the item or it does not live up to their expectations.  We understand this and will accept the item in return.  The buyer pays for shipping to return the product.  If your feel the item is not as described or just does not meet your expectations, please contact me.  In most cases we will issue a full refund of your initial purchase and shipping charges.  Of course the buyer is responsible for shipping the item to us intact.   You will have 30 days to inspect your item and ask for a return. This allows plenty of time to see if you like your item.  Thanks.\r\n\r\nFEED BACK:  I will leave positive feedback on all transactions.  I ask that before leaving negative feedback or damaging remarks, please contact me to resolve any issues.  With communication, most problems can  be worked out in a timely manner and to every ones satisfaction.\r\n\r\n\r\n",
        "policy_additional": "SALES TAX:  Washington State residents will be assessed a 9.9% across the board sale tax according to Washington State Law.  (Sorry)\r\nWe do custom orders at the request of the customer.  If you would like changes in color, materials, etc., please contact us.  There may, or may not be an additional charge.  If you desire more jewelry making items than are listed please contact us and we may be able to make a reserve listing for you to help you fill your desired amount.  We frequently have extras of the listed jewelry making items.\r\nSome items sold, notably necklaces, are listed as non-adjustable or one size.  If you would like the item altered let us know.  In most cases the product can be altered at no additional charge.\r\n\r\n",
