        "title": "Hand Made Gifts",
        "announcement": "Yay!! We are on Vacation!!\n\nDue to the summer holidays we will be away until mid-September. Orders placed from August 15th to Sept 9th will begin to ship on sept 10th. Please expect approximately 3-4 weeks before your order ships. Thank you! \nMari",
        "currency_code": "EUR",
        "is_vacation": false,
        "vacation_message": " VACATION!! MariGurumi Shop will not be taking new orders until September 1st. If you have an order in progress, be sure that it will be shipping as scheduled on you order, please check your Purchases Page to know your shipping date. \r\nWe will be answering messages daily so feel free to convo us if you have any questions or email us at marigurumi.shop@gmail.com\r\nHAPPY SUMMER!",
        "sale_message": "Thank you for your purchase!\n\nIf your order is a pattern, it will be sent in the following 24h via e-mail. \n\nIf your order is a physical item, please remember we are on Vacations from August 15th to September 9th. This means orders placed during that time will begin to ship on September 10th. Please allow approximately 3-4 weeks for your order to ship.\n\nThanks \nMari \n\r\n\r\n-Mari Carmen Idrovo from MariGurumi Shop",
        "digital_sale_message": "Thank you for your purchase!\r\n\r\nYour patterns will be sent by e-mail in less than 24 hours.\r\n\r\n-Mari Carmen Idrovo from MariGurumi Shop\r\n",
        "last_updated_tsz": 1553262033,
        "listing_active_count": 252,
        "digital_listing_count": 0,
        "login_name": "marigurumishop",
        "accepts_custom_requests": true,
        "policy_welcome": "Welcome to MariGurumi Shop!\r\n\r\nHere you&#39;ll find baby clothing ages 0-18 months, 100% cotton hand crocheted plushes, accessories and other gifts. All items are made with lots of care and heaps of love.\r\n\r\nI try to make them as identical to the original photo as possible, but they are hand made so may vary slightly. If I have any suggestions or changes to offer, I&#39;ll contact you first for your approval.\r\n\r\nI crochet, knit and sew as fast as I can, and have always overly fulfilled my shipping periods. If you&#39;re in a hurry please let me know and I can tell you exactly when it can ship your way :)",
        "policy_payment": "Payment is  made with Paypal or credit card. It&#39;s easy and secure.",
        "policy_shipping": "SHIPPING IN SPAIN is quick and efficient. Normally items take 3 days to be delivered. However, human errors can occur. If you haven&#39;t received your order after one week please contact me so I can find a quick solution. \n\nIf you need a speedier method, feel free to contact me.\n\nINTERNATIONAL SHIPPING times can vary depending on customs, festivities and different country policies.\nShipping to europe will usually take 1-2 weeks. USA, Australia and other international destinations can take 2-4 weeks.\n\nI can&#39;t be responsible for fees at customs in your country... and I have no idea what they could be! However I have not had any issues with this and I hope I never will :)",
        "policy_refunds": "If you would like to cancel an order, please let me know as soon as possible and I&#39;ll be happy to give you a refund, as long as the item has not yet shipped.\r\n\r\nIf you&#39;re not happy with your purchase upon receiving it, please contact me and i&#39;ll give you a refund as soon as I receive it back from you in perfect condition. Shipping costs will be payed for by the buyer.\r\n\r\nPDF patterns are fully downloadable the moment you place your order so unfortunately I am unable to refund these items.\r\n\r\nCustom items are generally non-refundable.",
        "policy_additional": "Would you like a custom order for something you didn&#39;t find at my store? Perfect!\r\nConvo me with your idea and I&#39;ll be more than happy to sketch something perfect for you to approve :)\r\n\r\nAll eyes used are safety eyes and have a washer attached to the back to avoid them being taken out. I myself cannot pull them out and would have to rip through the fabric.\r\n\r\nIn regards to the ears or other elements, they are hand stitched by me, so they&#39;re pretty tough!\r\n\r\nAnyhow, being a hand made, house made item, like many Etsy sold items, they have not been specifically inspected by any toy security authority and therefore it is the parent&#39;s choice to decide if it is suitable for their child to play with.\r\n\r\nIf the item is for a small child and you would prefer to have the eyes stitched in yarn, I will happily do that for you.\r\n\r\nI have a very friendly return policy, so if upon receiving the soft toy you are not satisfied with it, you can send it back and I will gladly refund you for the toy.  Custom items are non refundable.",
        "policy_seller_info": "",
        "policy_updated_tsz": 1515168091,
        "policy_has_private_receipt_info": false,
        "vacation_autoreply": "",
        "url": "https://www.etsy.com/shop/MarigurumiShop?utm_source=theironyardteaching&utm_medium=api&utm_campaign=api",
        "image_url_760x100": "https://i.etsystatic.com/iusb/f83768/13842842/iusb_760x100.13842842_mqj6.jpg?version=0",
        "num_favorers": 4320,
