        "policy_shipping": "PROCESSING TIME\nThe time I need to prepare an order for shipping varies. For details, see individual items.\n\nCUSTOMS AND DUTIES FEES\nBuyers are responsible for any customs or duties fees that may apply. Sellers aren't responsible for delays due to customs",
        "policy_refunds": "I GLADLY ACCEPT RETURNS AND CANCELLATIONS\nJust contact me within: 14 days of delivery\nShip returns back to me within: 30 days of delivery\nRequest a cancellation within: 2 days of purchase\n\nI DON'T ACCEPT EXCHANGES\nBut please contact me if you have any problems with your order.\n\nTHE FOLLOWING ITEMS CAN'T BE RETURNED\nBecause of the nature of these items, unless they arrive damaged or defective, I can't accept returns for:\n- Custom or personalized orders\n- Perishable products (like food or flowers)\n- Digital downloads\n- Intimate items (for health/hygiene reasons)\n- Items on sale\n\nCONDITIONS OF RETURN\nBuyers are responsible for return shipping costs.\nIf the item is not returned in its original condition, the buyer is responsible for any loss in value.",
        "policy_additional": "CAN I CHOOSE A DIFFERENT PICTURE FOR EACH CUFFLINK?\nYes, you can choose 2 different pictures for your custom photo cufflinks.\n\nHOW FAST CAN I RECEIVE MY ORDER?\nAll United States and international orders are sent with first class mail. You will have the option to upgrade your shipping method when you checkout.\n\nCurrent Processing times:\n1-2 business days\n\nShipping methods and transit times:\n\nUnited States:\nFirst Class Mail - $3.99 (3-7 days- Not Guaranteed)\nPriority mail- $8.49 (3-5 days- Not Guaranteed)\nExpress Mail- $25.49 (2 days- GUARANTEED)\n\nInternational:\nInternational First Class Mail $13.95 (1-3 weeks)\nInternational Priority mail- $33.00 (6-10 days)\nInternational Express Mail- $66.00 (3-5 days\n\nHOW DO I SEND MY PHOTO TO YOU?\nThere are 2 ways to send your photo to me.\n1. Use Etsy’s conversation messaging system. You will be able to attach your photo by \nClicking on “attach image” located at under the bottom right hand corner of the message box.\n2. Email your photo to me cufflinkphotoshop@gmail.com\n\nCAN I SEE WHAT MY CUFFLINKS WILL LOOK LIKE?\nYes. If you have ordered a pair of custom photo or customized cufflinks you will receive an example proof for your approval. I do not send your photo or customized cufflinks without your approval.\nPlease watch for an email or Etsy’s conversation message from me after you send me your photo or give me the customized details for your order.",
