      "description": "***Please read carefully our policies prior to submitting your order!!!\n\nFREE ENGRAVING 2 Piece Couple Set Black Tungsten Bands with Beveled Edge I Love You I Know Rings - 8mm & 6mm Black Tungsten Wedding Rings\n\nLadies Ring: I Love You - 6mm Beveled Edge Tungsten Ring\nMens Ring: I Know - 8mm Beveled Edge Tungsten Ring\n\nAVAILABLE IN: BLACK, BLUE, SILVER, ROSE GOLD, YELLOW GOLD, 12MM, 10MM, 8MM, 6MM, 4MM, 3MM, 2MM.\n\nPlease leave you custom engraving instructions with your order.\n\nUsually ships in 2 - 3 weeks! (Please see our shipping policies for more info)\n\nWE STRONGLY RECOMMEND THAT YOU GET YOUR FINGER PROFESSIONALLY MEASURED BEFORE PLACING YOUR ORDER.  \n\nNeed help figuring out your ring size?  Visit http://www.findmyringsize.com\n\nCUSTOM ORDERS (CUSTOM ENGRAVING) ARE FINAL SALE AND DO NOT QUALIFY FOR RETURNS OR EXCHANGES.\n\nDesign your own creation: ANY style, ANY size, ANY color, ANY finish, ANY laser engravings available upon request.  Custom orders will take 3 - 4 weeks to deliver.  \n\nA fantastic, elegant, and ultra-modern rings will stand out above the crowd. These shiny bands showcase a beveled edge with an interior polished finish and a polished outer finish. These tungsten carbide rings provide a tough exterior construction that boasts a modern stylish touch. The bands measure 8mm & 6mm wide and 2.3 mm thick to provide that high end feel with eye catching and fashionable look.\n\n- Custom size, design, and engraving orders welcome \n- Comfort Fit\n- Polished exterior finish\n- Polished interior finish\n- 8mm & 6mm in Width, 2.3mm in Thickness \n- Sizes 6 - 15, custom sizes available upon request\n- Hypoallergenic, Cobalt-Free\n- Sleek Design\n- Durable\n- Lifetime Warranty \n- 100% Satisfaction Guarantee \n\nVisit us on facebook, pinterest, and instagram where we give away FREE sample product.\n\nNeed help figuring out your ring size?  Visit http://www.findmyringsize.com\n\nDesign your own creation: ANY style, ANY size, ANY color, ANY finish, ANY laser engravings available upon request.  Custom orders will take 3 - 4 weeks to deliver.  \n\nOur pieces are made of 100% jewelry grade tungsten carbide.  Tungsten carbide is the most scratch resistant metal known to man.  It is ten times harder than 18k gold, five times harder than steel, and four times harder than titanium.  In short, it is the hardest metal on Earth.  Our tungsten bands give you peace of mind because they come with a Lifetime Warranty that covers accidental damage.\n\nThe unique formula of our tungsten carbide allows these rings to be both visually stunning and durable enough for every-day use. You are no longer required to constantly remove and replace your ring in order to protect its finish.  All of our tungsten carbide wedding bands are comfort fit style, providing optimal comfort while wearing the ring and when putting it on or removing it.  Because our tungsten carbide wedding bands are engineered to be maintenance free, we offer a lifetime warranty.\n\nThis product is not affiliated with or licensed by any professional sports team or official organization.  This product does not contain any proprietary logos, markings, colors, or fonts and is carefully made not to infringe on any copyright.  Lets talk copyright:  if you have any questions or comments please let us know.  \n\nAll good things are worth waiting for.  Most of our products are either custom made or made to order and may seem to take longer than usual to deliver.  Please note that we try hard to get your items to you as quick as possible, however some items need extra tender loving care to create.  We ensure that we deliver the best made masterpieces.  If you have any questions regarding delivery please contact us, we’d love to chat just about anything.\n\nANY ring, ANY design, ANY metal, ANY color, ANY font, ANY text, ANY logo, ANY wild idea, we can make for you. \n\nWe sell wholesale! For inquiries please contact us at cs@scorejewelry.com.\n\nVisit us on facebook, pinterest, and instagram where we give away FREE sample product.",
