        "announcement": "Thank you for visiting our Shop.  We introduce new models and designs on a weekly basis.  \nBEFORE YOU ORDER FROM US PLEASE VISIT OUR SHOP POLICY SECTION WHICH CONTAINS DETAILED INFORMATION ABOUT OUR SHIPPING AND ORDER FULFILLMENT PROCESS.  ALL ORDERS ARE CUSTOM LASER ENGRAVED IN OUR SHOP IN TORONTO, ON, CANADA.  ALL ORDERS SHIP BY REGULAR MAIL (WITH TRACKING) UNLESS INSTRUCTED OTHERWISE. \nSHIPPING BY REGULAR MAIL TAKES ABOUT 10 - 14 DAYS, SOMETIMES LONGER.  SHIPPING BY REGULAR MAIL IS UNPREDICTABLE AND NO DELIVERY TIME IS GUARANTEED.  WE CANNOT CONTROL THE SPEED OF REGULAR MAIL AND ARE NOT RESPONSIBLE FOR ANY DELAYS IN RECEIVING YOUR ORDER.  WE OFFER EXPEDITED SHIPPING FOR AN ADDITIONAL FEE ON ALL ORDERS WHICH IS ABOUT 3 - 5 DAYS.  MORE INFORMATION ABOUT SHIPPING AND PROCESSING IS AVAILABLE IN OUR SHOP POLICY SECTION.\n\n***********************************************************************************************\nPLEASE DO NOT ORDER FROM US UNTIL YOU HAVE READ OUR SHOP POLICY SECTION.\n************************************************************************************************\n\nALL ORDERS ARE CUSTOM ENGRAVED AND TAKE AT LEAST 2 - 3 WEEKS TO MAKE.  WE DO NOT STOCK INVENTORY.  WE ARE ABLE TO RUSH ANY ORDER, SIMPLY CONVO US FOR DETAILS.\n\n***************NEW NEW NEW - CUSTOMER SATISFACTION AT ITS FINEST*************  We are the one and ONLY shop on Etsy or anywhere else on the internet that exchanges wrongly ordered ring size for FREE - WITH NO RETURN!!!!  (please read below for details).  \n\n************NEW NEW NEW - PRICE MATCH GUARANTEE************\nIf you find a ring we carry (or similar) anywhere else on the internet, we will match or beat their advertised price!  We do reserve the right to reject this policy if the item is considerably different than ours.  We reserve the right to change or cancel this policy at any time with or without notice.  Our prices and quality will not be beat!!! \n\nThe true originator of epically designed rings!!!  We update our shop weekly with fresh designs perfect for any occasion.  GET YOUR FRIENDS JEALOUS!  Getting married?  Check out our couple ring sets or design your very own.  We&#39;ll make you a ring you&#39;ll be proud to wear from  ANY model, ANY design, ANY Metal, ANY color, ANY font, ANY text, ANY logo, ANY wild idea.  Each piece found in our shop is hand crafted with the utmost care.  Your satisfaction is our success! Our dedicated staff at Score Jewelry understand that success goes hand in hand with customer satisfaction and we work hard to excel in it.  We bring you the best service in the business combined with a risk free shopping experience.  We&#39;ll never let a customer down! \n\nANNOUNCEMENT! We are now proud to offer our shoppers with a FREE gift.  Send us your creative idea for a custom band design, and if we use it in our etsy shop, you&#39;ll get one tailored to you for FREE.  \n\n***************NEW NEW NEW - CUSTOMER SATISFACTION AT ITS FINEST*************\n\nNEW NEW NEW - HEADACHE FREE EXCHANGES:  ORDERED THE WRONG RING SIZE? THATS GREAT! KEEP IT AND WE&#39;LL SEND YOU A BRAND NEW ONE IN THE CORRECT SIZE FREE!!!!! SIMPLY PAY THE SHIPPING (THIS APPLIES FOR MOST RING MODELS, NOT ALL).  Thats how much we care about customer satisfaction! *some restrictions apply.  Please convo us for details.  We reserve the right to refuse this policy if we determine that its being abused, or for any other reason we see fit.\n\nVisit us:\nwww.facebook.com/scorejewelry\nwww.instagram.com/scorejewelry\nwww.pinterest.com/scorejewelry   \nwww.scorejewelry.com",
