        "vacation_message": null,
        "sale_message": "PLEASE READ THIS ENTIRE MESSAGE!  Thank you for shopping with us.  If you have any questions or comments please do not hesitate to ask.  We know you&#39;re excited about receiving your item.  Please visit our policy section to find out more information about delivery times.  Once you receive your item, please do not hesitate to get in touch with us with any concerns or problems associated with what you&#39;ve received.  We are a customer satisfaction oriented business and will not let a customer down.  We stand behind our products and your satisfaction is our top priority.  We go way above and beyond any means to make sure you&#39;ll be a happy customer and be proud to wear our jewelry.  Before leaving any negative feedback or reviews we ask that you first allow us the opportunity to correct any problems that you encounter while doing business with us.  Although we cannot offer any incentive for leaving feedback, a positive review of our shop would help us grow our business and would be very much welcomed.  Thanks again for shopping with us.  Score Jewelry\r\n\r\nWE ARE THE ONLY SHOP THAT MAKES OUR CUSTOMERS FREE RINGS IF THEY ORDERED ONE FROM US IN THE WRONG SIZE. \r\n*buyer is responsible to pay for shipping\r\n*please see more details in our refund policy section.\r\n\r\nORDERS ARE USUALLY PROCESSED 2 - 3 WEEKS AFTER ORDER HAS BEEN PLACED!  SOME ORDERS MAY TAKE LONGER TO MAKE THAN THE USUAL 2 - 3 WEEKS.\r\n\r\nALL ORDERS ARE SHIPPED VIA REGULAR REGISTERED MAIL WHICH TAKES ABOUT 10 - 14 DAYS TO DELIVER, SOMETIMES LONGER.  PLEASE READ OUR SHIPPING POLICY CAREFULLY BEFORE YOU BUY FROM US!  WE CANNOT CONTROL THE SPEED OF REGULAR MAIL. \r\n\r\nRush/expedite service will always be available for an additional fee.  Please convo us for more details. \r\n\r\n***ALL OUR RINGS ARE CUSTOM ENGRAVED WITH OUR COMPANY LOGO INSIDE THE RING.  IF YOU WISH FOR US TO OMIT OUR COMPANY BRANDING FROM INSIDE THE RING, PLEASE MESSAGE US IMMEDIATELY***\r\n\r\n***Our goal is to keep our items for sale as fairly priced as possible.  In order to cut shipping costs we use a fulfillment center that is located overseas to ship MOST of our orders.  The fulfillment center packages our orders in an elegant velvet ring box FREE of charge to our buyers, then packages the ring box in a corrugated box, and uses our pre-printed shipping labels to ship the package to you.  We are able to offer many of our listings with FREE shipping due to this cost saving fulfillment process.  WITHOUT ANY EXCEPTION, EVERY SINGLE ITEM WE MAKE IS CUSTOM LASER ENGRAVED IN OUR SHOP IN TORONTO, CANADA.  WE DO NOT STOCK INVENTORY, EACH ORDER IS CUSTOM MADE TO ORDER.***",
